import React from 'react';
import StageDispoList from "../components/StageDispoList";

function StageDispo(){
    return (
          <div>
            <h1>Voici la liste des cours enseignés au cégep</h1>
            <StageDispoList />
          </div>
      );
}

export default StageDispo;
